/**
* Definition for singly-linked list.
* struct ListNode {
*     int val;
*     ListNode *next;
*     ListNode(int x) : val(x), next(NULL) {}
* };
*/
class Solution {
public:
	void reorderList(ListNode* head) {
		if (NULL == head)
			return;

		ListNode* pNodeRun = head;
		ListNode* pNodeWalk = NULL;

		// find mid node.
		while (pNodeRun != NULL){
			if (pNodeWalk == NULL)
				pNodeWalk = head;
			else
				pNodeWalk = pNodeWalk->next;
			pNodeRun = pNodeRun->next;
			if (pNodeRun != NULL)
			{
				pNodeRun = pNodeRun->next;
			}
		}
		//reverse the 2nd half.
		ListNode* p2ndhalf = reverseList(pNodeWalk->next);
		pNodeWalk->next = NULL;

		//interleave the 1st & 2nd half.
		interleaveList(head, p2ndhalf);
	}

	ListNode* reverseList(ListNode* head){
		if (NULL == head)
			return NULL;

		ListNode* pNodeCurr = head;
		ListNode* pNodeNext = head->next;
		head->next = NULL;
		while (pNodeNext != NULL){
			ListNode* pNew = pNodeNext->next;
			pNodeNext->next = pNodeCurr;
			pNodeCurr = pNodeNext;
			pNodeNext = pNew;
		}

		return pNodeCurr;
	}

	void interleaveList(ListNode* head, ListNode* interleaves)
	{
		ListNode* pNode1 = head;
		ListNode* pNode2 = interleaves;
		while (pNode1 != NULL && pNode2 != NULL)
		{
			ListNode* pNewNode1 = pNode1->next;
			ListNode* pNewNode2 = pNode2->next;
			pNode1->next = pNode2;
			pNode2->next = pNewNode1;

			pNode1 = pNewNode1;
			pNode2 = pNewNode2;
		}
	};

	void reorderListRec(ListNode* head) {
		if (NULL == head)
			return;

		ListNode* pLast = NULL;
		ListNode* p2ndLast = NULL;
		for (ListNode* pNode = head->next; pNode != NULL; pNode = pNode->next)
		{
			p2ndLast = pLast;
			pLast = pNode;
		}

		if (p2ndLast != NULL){
			p2ndLast->next = NULL;
			reorderList(head->next);
			pLast->next = head->next;
			head->next = pLast;
		}
		return;
	}
};

